import React from 'react';
import ReactDOM from 'react-dom';

const Modal = (props) => {
	return ReactDOM.createPortal(
		<div
			style={{
				backgroundColor: '#fff',
				width: '500px',
				height: '200px',
			}}>
			Teste
		</div>,
		document.querySelector('#modal')
	);
};

export default Modal;
